import { BrowserRouter, Route, Switch } from "react-router-dom";
import Catalog from "./page/Catalog/Catalog";
import Home from "./page/Home/Home"

function App() {
  return (

    <Route>
      <Route path="/">
        <Home />
      </Route>
      <Route path="Catalog">
        <Catalog />
      </Route>
    </Route>

  );
}

export default App;
